import React, { useState, useCallback, useEffect } from "react";

import {
  getAllPersonen as dbGetAllPersonen,
  deletePerson as dbDeletePerson,
  createPerson as dbCreatePerson,
  replacePerson as dbReplacePerson,
} from "../../services/personen";

import { getAllVereine as dbGetAllVereine } from "../../services/vereine2";

import { MenueHeader } from "../MenueHeader";

import { MitgliederTable } from "./MitgliederTable";
import { MitgliedViewForm } from "./MitgliedViewForm";
import { MitgliedEditForm } from "./MitgliedEditForm";

const Mitglieder = () => {
  const [mitgliedFormEditMode, setMitgliedFormEditMode] = useState(false);
  const [loading, setLoading] = useState(false);

  const [personId, setPersonId] = useState(0);
  const [person, setPerson] = useState([]);
  const [personen, setPersonen] = useState([]);

  const [vereine, setVereine] = useState([]);

  const [btnLöschenIsDisabled, setBtnLöschenIsDisabled] = useState(true);
  const [btnNeuePersonIsDisabled, setBtnNeuePersonIsDisabled] = useState(false);
  const [btnÄndernIsDisabled, setBtnÄndernIsDisabled] = useState(true);
  const [modusNeuePerson, setModusNeuePerson] = useState(true);

  const onRowSelect = useCallback((event) => {
    setMitgliedFormEditMode(false);
    setBtnLöschenIsDisabled(false);
    setBtnÄndernIsDisabled(false);
    setPersonId(event.data.id);
    setPerson(personen.filter((personen) => personen.id === event.data.id));
  });

  const editPerson = useCallback(() => {
    setBtnLöschenIsDisabled(true);
    setMitgliedFormEditMode(true);
    setBtnÄndernIsDisabled(true);
    setModusNeuePerson(false);
  });

  const deletePerson = useCallback(() => {
    setBtnLöschenIsDisabled(true);
    setBtnÄndernIsDisabled(true);
    dbDeletePerson(personId);
    setLoading(!loading);
  });

  const btnAbbruch = useCallback(() => {
    setBtnLöschenIsDisabled(true);
    setMitgliedFormEditMode(false);
    initPerson(setPerson);
  });

  const btnNeuePerson = useCallback(() => {
    // Felder leeren und auf Input umschalten
    setModusNeuePerson(true);
    setBtnLöschenIsDisabled(true);
    setBtnÄndernIsDisabled(true);
    setBtnNeuePersonIsDisabled(false);
    setMitgliedFormEditMode(true);

    initPerson(setPerson);
  });

  const btnSpeichern = useCallback((person) => {
    setBtnLöschenIsDisabled(true);
    setBtnÄndernIsDisabled(true);

    if (modusNeuePerson) {
      dbCreatePerson(person);
    } else {
      person.id = personId;
      dbReplacePerson(person);
    }
    btnAbbruch();
    setLoading(!loading);
  });

  const btnStartMenue = useCallback(() => {
    // prüfen, ob die Daten plausibel sind (also nicht leer, Änderung gegenüber den vorherigen, ...)
    window.location.href = "/startmenue";
  });

  useEffect(() => {
    dbGetAllPersonen().then((personen) => {
      setPersonen(personen);
    });
    dbGetAllVereine().then((vereine) => {
      setVereine(vereine);
    });
    console.log(vereine);

    initPerson(setPerson);
  }, [loading]);

  useEffect(() => {}, [person]);

  const mitgliederAnz = personen.length; // Anzahl der Mitglieder

  return (
    <>
      <MenueHeader headerText={mitgliederAnz + " Mitglieder"} />
      <MitgliederTable
        selectedPerson={personId}
        personen={personen}
        onRowSelect={onRowSelect}
      />
      <div>
        <br />
        <div>
          {mitgliedFormEditMode ? (
            <MitgliedEditForm
              modusNeuePerson={modusNeuePerson}
              onSpeichern={btnSpeichern}
              onAbbruch={btnAbbruch}
              person={person}
              vereine={vereine}
            />
          ) : (
            <MitgliedViewForm
              onNeuePerson={btnNeuePerson}
              btnNeuePerson={btnNeuePersonIsDisabled}
              onÄndernPerson={editPerson}
              btnÄndernPerson={btnÄndernIsDisabled}
              onDeletePerson={deletePerson}
              btnLöschenPerson={btnLöschenIsDisabled}
              onStartMenue={btnStartMenue}
              person={person}
            />
          )}
        </div>
      </div>
    </>
  );
};

export default Mitglieder;

function initPerson(setPerson) {
  setPerson([
    {
      pers_name: " ",
      pers_vorname: " ",
      pers_geburtsdatum: " ",
      pers_gender: " ",
      pers_strasse: " ",
      pers_plz: " ",
      pers_ort: " ",
      pers_telefon_privat: " ",
      Pers_TelefonMobil: " ",
      pers_email: " ",
      pers_status: " ",
      pers_status_datum: " ",
      pers_bank: " ",
      pers_iban: " ",
      pers_bic: " ",
    },
  ]);
}
